import { createApp } from 'vue';
import App from './App.vue';
import router from './router';
import '@/assets/css/TransportCompanyConversionTable.scss'; 
import '@/assets/css/AppLayout.scss';
import '@/assets/css/BusinessPartnerDialog.scss';
import '@/assets/css/SupplierDialog.scss';
import '@/assets/css/CustomerDialog.scss';
import '@/assets/css/DepartmentDialog.scss';

const app = createApp(App);
app.use(router);
app.mount('#app');
